import React from 'react';
import './HorizontalNav.css';

const HorizontalNav = () => {
  return (
    <nav className="horizontal-nav">
      <ul>
        <li>Accueil</li>
        <li>Profil</li>
        <li>Réglage</li>
        <li>Communauté</li>
      </ul>
    </nav>
  );
};

export default HorizontalNav;
